fn:
(body) => {
    let res = {};
    let tds = body.querySelectorAll('td');
    let current = '';
    for (let i = 1; i < tds.length; i++) {
        let strong = tds[i].querySelector('strong');
        if (strong) {
            current = strong.innerText;
            res[current] = [];
        }
        else {
            let name = tds[i].innerText;
            let idx = name.indexOf('(');
            if (idx > -1) {
                name = name.substr(0, idx).trim();
            }
            res[current].push(name);
        }
    }
    console.log(JSON.stringify({
        source: "https://www.globalbrandsmagazine.com/list-of-banks-by-country/",
        fn: fn.toString(),
        data: res
    }, null, 2));
}
